import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
    {
        id: "e1",
        title: "Some event",
    },
    {
        id: "e2",
        title: "Another event",
    },
]

function EventsPage() {
    return (
        <>
            <h1>EventsPage</h1>
            {DUMMY_EVENTS.map(event => <li key={event.id}></li>)}
            <Link to={`/events/$`}></Link>
        </>
    )
}

export default EventsPage;
